      // results = houselisting.map((house, index) => 
      // <ListingCard key={house.sys.id} {...house} />);

      results = sf_housing_data.map ((houses) =>
      // <ListingCard key={houses} {...house} />);
       {
          // if (!!houses.zpid) {
          //   //with zpid
          //   return  <ListingCard key={houses.zpid} {...houses} 
          // houseCompareTable={houseCompareTable} setHouseCompareTable={setHouseCompareTable}/>
          // } else {
          //   //with buildingId
          // return <ListingCard key={houses.buildingId} {...houses} 
          // houseCompareTable={houseCompareTable} setHouseCompareTable={setHouseCompareTable}/>
          // }

          if (!!houses.zpid) {
            //with zpid
            return  <ListingCard key={houses.zpid} house={houses}
            houseCompareTable={houseCompareTable} setHouseCompareTable={setHouseCompareTable}/>
          } else {
            //with buildingId
            return <ListingCard key={houses.buildingId} house={houses}
            houseCompareTable={houseCompareTable} setHouseCompareTable={setHouseCompareTable}/>
          }
       }

      );
    } else {
      results = (
        <div>
          <h2>Sorry!</h2>
          <h3> No listings available yet.</h3>
        </div>
      );
    }

    return (
      <div className="listings">
        <div className="listings-container" >
          <div className="listings-container-header">
            <button onClick={()=>viewCompareTable(houseCompareTable)}>view Copmare Table</button>
          </div>
          <div className="listings-container-content">
            {results}
          </div>
        </div>
          {/* <div className="map-container"> 
            <MapContainer />
          </div> */}
        </div>
  )
}
